import React from "react";

function JobsCategory() {
  return (
    <div>
      <section>
        <div className="container mx-auto px-4">
          <div>
            <h6>Jobs Categories</h6>
          </div>
        </div>
      </section>
    </div>
  );
}

export default JobsCategory;
